export const errorNotification = (title="Erorr!") => {
    return MySwal.fire({
        icon: 'error',
        title: <p>Cannot save your entry.</p>,
        didOpen: () => {
            MySwal.clickConfirm()
        }
    }).then(() => MySwal.fire('Cannot save your entry.', '', 'error'));
}
